INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(1, 'High School DxD', 'data:image/png;base64,', 'Comedia, Demonios, Ecchi, Escolares, Harem, Romance', 'La historia está protagonizada por Issei Hyoudou, un muchacho de segundo año de instituto bastante salido al que una chica asesina en la primera cita de su vida. Issei se reencarna como demonio, y desde ese mismo día trabaja como sirviente de Riasu, una chica demonio de altísimo nivel que resulta ser la más guapa y popular de todo el instituto.', '2013-07-07');
