INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(5, 'Overlord', 'data:image/jpeg;base64,', 'Acción, Aventuras, Fantasía, Juegos, Magia, Sobrenatural', 'La historia da comienzo cuando Yggdrasil, un popular juego online, es cerrado un día sin previo aviso. Sin embargo, el protagonista, Momonga, decide no salir del juego. Momonga así se transforma y se convierte en “el mago más poderoso”. El mundo sigue cambiando con él dentro, y los NPCs comienzan a sentir emociones. Sin familia, amigos ni lugar en la sociedad, Momonga tendrá que luchar por adaptarse al nuevo mundo en el que se ha convertido el juego.', '2015-07-07');
INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
