INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(9, 'Futoku no Guild', 'data:image/jpeg;base64,', 'Comedia, Ecchi, Fantasía, Harem, Shounen', 'Kikuru Madan es un cazador de monstruos con un excelente rendimiento debido a su particular trabajo en el bosque. Pero ha decidido dejar su trabajo por miedo a desperdiciar su propia juventud. En realidad, la verdadera razón es que uno de sus amigos se casó. Un día hay un nuevo recluta promesa. Enome, la recepcionista del gremio, le pide que acompañe a Hitamu Kyan, la artista marcial erótica, para mantenerla a salvo y enseñarle a trabajar. Así que decidió aceptar la petición. La razón es que se preocupaba por ella y que quería convertirla en su sucesora antes de retirarse por completo. Lamentablemente, su plan de retirarse se derrumba con la inutilidad de Hitamu, que siempre atrae a los monstruos. Entonces, ¿podrá Kikuru Madan retirarse en paz, con la presencia de algunos inútiles aprendices?', '2022-10-05');
INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(10, 'Kimi to Boku no Saigo no Senjou, Aruiwa Sekai ga Hajimaru Seisen', 'data:image/jpeg;base64,', 'Acción, Fantasía, Militar, Romance', 'El Imperio, dotado de un nivel avanzado de conocimiento, y la Agencia de la Casa Imperial de Nebulis temida como el «País de las Brujas», mantienen una lucha que dura en el tiempo. En el campo de batalla un chico y una chica se conocen. El espadachín que se convirtió en la fuerza definitiva en el campo de batalla a la edad más joven a lo largo de toda la historia del Imperio: Iska. La princesa bruja de hielo elogiada como la más fuerte de toda la Agencia de la Casa Imperial: Aliceliese. Ambos quedan enamorados uno del otro, ¿nuestra última cruzada o el inicio de un nuevo mundo?', '2019-10-20');
INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(11, 'Otome Game no Hametsu Flag shika Nai Akuyaku Reijou ni Tensei shiteshimatta...', 'data:image/jpeg;base64,', 'Comedia, Drama, Escolares, Fantasía, Romance', 'Katarina Claes, de ocho años, es la única hija de un duque, vive su vida pacíficamente y sin incidentes hasta que se golpea la cabeza contra una roca ... y luego recuerda que en realidad no es la hija del duque. Solía ​​ser una otaku que murió camino a la escuela después de pasar la noche anterior jugando Fortune Lover, su juego de otome favorito. Después de darse cuenta de que su entorno actual parece extrañamente familiar, se sorprende al descubrir que se ha reencarnado en el mundo de Fortune Lover como la villana. La villana en el juego generalmente termina muerta o exiliada, por lo que Katarina decide usar su conocimiento del juego y sus rutas para evitar situaciones malas. Pero, ¿es posible que la villana llegue a un buen final?', '2020-04-04');
INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(12, 'Tsuki ga Michibiku Isekai Douchuu', 'data:image/jpeg;base64,', 'Aventuras, Fantasía', 'La historia de fantasía se centra en Makoto Misumi, un chico ordinario de preparatoria que es enviado a un nuevo mundo como un valiente guerrero. Desafortunadamente, la diosa de ese nuevo mundo le dijo con desdén: “Qué feo eres”, lo despojó de su título y lo desterró a los confines más remotos del desierto. Mientras deambulaba por la zona, Makoto se encontró con dragones, arañas, orcos, enanos y todo tipo de criaturas fantásticas. Debido a las diferencias en el entorno de su mundo natal, Makoto ahora exhibe extraordinarios poderes mágicos y de combate. Por lo tanto sobrevive en este mundo mientras se enfrenta a varias amenazas. Se levanta así el telón de la fantasía de reforma social del mundo alterno, centrada en un joven abandonado por los dioses y por los humanos.', '2021-07-07');
INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(13, 'Kumo Desu ga, Nani ka?', 'data:image/jpeg;base64,', 'Aventuras, Comedia, Fantasía', 'El mundo donde el Héroe y el Rey Demonio continúan oponiéndose el uno al otro. La gran magia del Héroe y el Rey Demonio cruzan mundos y explotan en el aula de una cierta escuela secundaria. Los estudiantes que murieron en la explosión reencarnarán en un mundo diferente. La protagonista, que tiene la reputación más baja de la clase, reencarnó en una araña. Sin embargo, ella se adaptó rápidamente a la condición presente con gran fuerza de voluntad. Esta es una historia de una araña intentando todo lo que puede para sobrevivir.', '2021-01-08');
INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(14, 'Gotoubun no Hanayome', 'data:image/jpeg;base64,', 'Comedia, Escolares, Harem, Romance, Shounen', 'Fuutarou Uesugi es un estudiante de segundo año de preparatoria/instituto cuya familia siempre ha sido muy pobre. Un día recibe una suculenta oferta de trabajo como tutor a medio tiempo... ¡pero sus estudiantes resultan ser unas chicas de su propia clase! Para complicar más las cosas, son quintillizas... Las cinco hermanas son todas muy atractivas, pero no es lo único que tienen en común: todas odian estudiar y sus calificaciones siempre están al límite de la catástrofe. Tendrá que conseguir que las cinco estudien, pero primero tendrá que estudiar él cómo ganarse su confianza.', '2019-01-10');
INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(15, 'Gotoubun no Hanayome 2nd Season', 'data:image/jpeg;base64,', 'Comedia, Escolares, Harem, Romance, Shounen', 'Un día, el estudiante pobre de preparatoria Fuutarou Uesugi recibe un trabajo como tutor con una excelente paga. Una excelente oportunidad de hacer dinero, ¿no? ¡Pues resulta que su tutorada es su compañera de clases! ¡Y no sólo le enseñará a ella sino también a sus cuatro hermanas! ¡Sí! ¡Son quintillizas! Todas ellas son hermosas, pero a diferencia de sus apariencias, sus actitudes son completamente diferentes. ¿Podrá Fuutarou hacer que las quintillizas Nakano se gradúen con éxito de la preparatoria? ¿Se enamorará de alguna de ellas?', '2021-01-07');
INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(16, 'Kuma Kuma Kuma Bear', 'data:image/webp;base64,', 'Aventuras, Comedia, Fantasía', 'Yuna, una chica de quince años, comienza a jugar su primer juego VRMMO. Ella ha conseguido miles de millones de yenes en acciones, y se confina en su casa para jugar sin ir a la escuela. Hoy, una actualización importante ha llegado al juego y ella obtiene un súper raro e intransferible traje de oso. Pero usarlo es tan vergonzoso que no se atreve a equiparlo, ni siquiera ayuda el hecho de que solo es un juego. Además, cuando responde la encuesta de satisfacción sobre la nueva actualización y reinicia el juego, ella descubre que está en un extraño bosque y está vistiendo el traje de eso. ¿Dónde estoy? ¿Un mensaje de Dios? ¿Un mundo diferente? Si ella está usando el traje de oso (que es un objeto poderosísimo) significa que es invencible, pero si se lo quita es solo una chica normal. ¡La aventura que Yuna nunca pidió acaba de comenzar!', '2020-10-07');
INSERT INTO `series` (`id`, `nombre`, `imagen`, `generos`, `sinopsis`, `fecha_inicio`) VALUES
(17, 'Kami-tachi ni Hirowareta Otoko', 'data:image/jpeg;base64,', 'Aventuras, Fantasía, Recuentos de la vida', '¡Bajo la protección de los dioses, su relajada vida con los slimes comienza! Un día, la vida de un hombre japonés de mediana edad llamado Ryoma Takebayashi llega a un espontáneo y decepcionante final. Ryoma nunca fue agraciado en su vida, pero después de la muerte, tres dioses solicitaron su cooperación y lo reencarnaron como un chico en un mundo de espadas y magia. Recibiendo una cordial y divina bienvenida por los propios dioses, Ryoma decide vivir de forma relajada en el bosque por el momento. Trabajando diligentemente en cazar y aprender magia, su mayor pasión se vuelve… ¿entrenar slimes?', '2020-10-04');

